import React from 'react';
import '../../App.css';
import './Myslibros.css';
import LeagueProfile from './LeagueProfile';
import {Link} from 'react-router-dom';

/**
 * Myslibros Screen
 */
function Myslibros() {
    return (
      <div className="myslibros-container">
        <div className="myslibros-header">
          <h1>µslibros</h1>
        </div>
        <div className="myslibros-content-container">
          <div className="row-1">
            <Link to={`/league-of-legends/`} className="profile-link"><LeagueProfile leagueName="µ" /></Link>
            <Link to="" className="profile-link"><LeagueProfile leagueName="Not Depression" /></Link>
            <Link to="" className="profile-link"><LeagueProfile leagueName="Protect Jhin" /></Link>
          </div>
            <div className="row-2">
            <Link to="" className="profile-link"><LeagueProfile leagueName="StrongApe" /></Link>
            <Link to="" className="profile-link"><LeagueProfile leagueName="DunkTown Xpress" /></Link>
            <Link to="" className="profile-link"><LeagueProfile leagueName="Big Drip 808" /></Link>
          </div>
          <div className="row-3">
            <Link to="" className="profile-link"><LeagueProfile leagueName="ShirosCloud" /></Link>
            <Link to="" className="profile-link"><LeagueProfile leagueName="KurosCloud" /></Link>
            <Link to="" className="profile-link"><LeagueProfile leagueName="ezy af" /></Link>
          </div>
        </div>
      </div>
    );
}

export default Myslibros;
